import React,{Component} from "react";
import Children from "./Children";
import "./App.css"
import arr from "./info";
class App extends Component {
  constructor(){
    super();
    this.state = {
      arr:info
    }
  }  

  render(){   
    const info = this.state.arr.map(e => 
        <Children  
          f_name={e.f_name}  
          l_name={e.l_name}  
          age={e.age} 
          email={e.email} 
          user_name={e.user_name}
        />)

    return (
      <div className="App">
          {info}
      </div>
    );
  }
}

export default App;
